import React from 'react';
import styled from "styled-components";
import hk from './hk.jpg';

export const App = () => {
  return (
    <Background>
      <Container>
<FrontPage>
<h1>Soliman Doe
DESIGNER DEVELOPER FREELANCER
    </h1>
</FrontPage>
<About>
<h1> Hi there, I'm Soliman Doe</h1>
</About>
<Services>
<h1>This is what I do</h1>
<ServiceSection>

<ServiceCard>
  <h2>First example</h2>
</ServiceCard>
<ServiceCard>
  <h2>Second example</h2>
</ServiceCard>
<ServiceCard>
  <h2>Third example</h2>
</ServiceCard>

</ServiceSection>

</Services>
<Portfolio>
<h1>This is what I've done</h1>

</Portfolio>
<Contact>
<h1>How to contact me</h1>
</Contact>
      </Container>
    </Background>
  )
}


const Background = styled.main`
background-image: linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)), url(${hk});
background-position: center;
background-repeat: no-repeat;
background-size: cover;
background-attachment: fixed;
height: 100%; 
width: 100%; 
`

const Container = styled.div`
`
const FrontPage = styled.div`
display: flex; 
justify-content: center; 
align-items: center; 
height: 100vh; 
` 

const About = styled.div`
height: 100vh; 
border: 1px solid white; 
background-color: rgba(0, 0, 0, 0.4);




`

const Services = styled.div`
height: 100vh; 
border: 1px solid white; 
display: flex; 
flex-direction: column;
justify-content: center; 
align-items: center;  
`

const ServiceSection =styled.div`
display: flex;
`

const ServiceCard = styled.div`
background-color: rgba(0, 0, 0, 0.4);
display: flex;
box-sizing: border-box;

padding: 20px; 

`



const Portfolio = styled.div`
height: 100vh; 

border: 1px solid white; 



`

const Contact = styled.div`
height: 100vh; 

border: 1px solid white; 



`
